  public static void main(String[] args)
  {
    int[] dims = new int[]{0, 0};
    for (int i = 0; i < input.length; i++)
    {
      if (dims[0] < input[i].l + input[i].w)
        dims[0] = input[i].l + input[i].w;
      if (dims[1] < input[i].t + input[i].h)
        dims[1] = input[i].t + input[i].h;
    }

    boolean[][] overlaps = new boolean[dims[0]][dims[1]];
    boolean[] hasOverlaps = new boolean[input.length];
    for (int i = 0; i < input.length; i++)
      for (int j = 0; j < input.length; j++)
        if (i!=j && overlap(input[i], input[j], overlaps))
        {
          hasOverlaps[i] = true;
          hasOverlaps[j] = true;
        }
    long ct = 0;
    for (int i = 0; i < dims[0]; i++)
      for (int j = 0; j < dims[1]; j++)
        if (overlaps[i][j])
          ct++;
    System.out.println("Part 1: " + ct+" sq in");

    for (int i = 0; i < input.length; i++)
      if (!hasOverlaps[i])
        System.out.println("Part 2: #"+(i+1));
  }

  public static boolean overlap(Claim a, Claim b, boolean[][] overlaps)
  {
    boolean didOverlap = false;
    for (int x = a.l; x < a.l+a.w; x++)
      for (int y = a.t; y < a.t+a.h; y++)
        if ( b.contains(x+1, y+1))
        {
          didOverlap = true;
          //System.out.println((i + a.l) + " " + (j + a.t));
          overlaps[x][y] = true;
        }
    return didOverlap;
  }

  public static class Claim
  {
    int l, t, w, h;

    public Claim(int l, int t, int w, int h)
    {
      this.l = l;
      this.t = t;
      this.w = w;
      this.h = h;
    }

    public boolean contains(int x, int y)
    {
      if (x > l && x <= l + w)
        if (y > t && y <= t + h)
          return true;
      return false;
    }
  }
